// Imports
import Router from 'next/router';
import Cookies from 'js-cookie';

// Context
import View from '../lib/React/ViewContext';

// Components
import GroceryForm from '../components/GroceryForm';
import GroceryList from '../components/GroceryList';

const Home = () => {
  if (Cookies.get('grocerylist_auth_token')) {
    return (
      <View>
        <GroceryForm />
        <GroceryList />
      </View>
    );
  } else {
    Router.push('/signin');
    return <div>Nothing</div>;
  }
};

export default Home;
